        uint256 date;
        address powner;
        address cowner;
        bool corrupt;
        string date2;
    }
    struct dlisting{
        uint256 nftId;
        uint256 price;
        uint256 date;
        bool corrupt;
        string date2;
    }
    struct blisting{
        string videoLink;
        uint256 royaltyPercent;
        address owner;
        string name;
        bool onsell;
        uint256 id;
        uint256 price;
        uint256 date;
        bool corrupt;
        string date2;
    }
    struct auclisting{
        string videoLink;
        uint256 royaltyPercent;
        address owner;
        string name;
        bool onsell;
        uint256 nftId;
        uint256 sprice;
        uint256 cprice;
        uint256 date;
        address powner;
        address cowner;
        bool corrupt;
        string date2;
    }
    uint256 nftCount=0;
    uint256[] darray;
    uint256[] aarray;
    mapping(address => uint256[]) nft;
    mapping(uint256 => nftdet) nftDetails; 
    mapping(uint256 => alisting) nftaList;
    mapping(uint256 => dlisting) nftdList;


    // function ownDisplay(address _user)public view returns(videonomap[] memory){
